import React from 'react'

function FloatButton() {

    return (
        <div style={{
            position: 'fixed',
            bottom: 40,
            right: 40
        }}>
            <div style={{
                borderRadius: 50,
                width: 60,
                height: 60,
                background: "#3972F5",
                display: 'flex',
                flex:1,
                justifyContent:'center',
                alignItems: 'center',
                color:'#fff',
                boxShadow:'2 2 3 #999'
                
            }} >
                <i className='fa fa-plus' />
            </div>
        </div>
    )
}
export { FloatButton }
